#### Hotspots

::: {.callout-note}
Hotspots of **corrected weighted endemism** were identified in both the combined dataset and the preserved specimen only dataset (Figure 9).
:::

Both datasets showed a large hotspot in south-west Western Australia. The preserved specimen only dataset also showed a small cluster located between Canberra and Sydney in New South Wales, while the full dataset instead showed a small hotspot in far north Queensland at the tip of Cape York (Figure 9).












